import { Component } from '@angular/core';

@Component({
  selector: 'app-employee-list',
  templateUrl: './employee-list.component.html',
  styleUrls: ['./employee-list.component.css']
})
export class EmployeeListComponent {
  employees = [
      {
        id : 101,
        name : "Raj",
        department : "Frontend",
        empType : "Internship",
        date: new Date(),
      },
      {
        id : 102,
        name : "Darshan",
        department : "Database",
        empType : "Internship",
        date: new Date(),
      },
      {
        id : 103,
        name : "Anirudh",
        department : "BA",
        empType : "Internship",
        date: new Date(),
      }
  ]
}
